import Axios from 'axios';
import React, { useEffect } from 'react';
// import $ from 'jquery';
// import Popper from 'popper.js';
import Router from './containers/router';
function App() {
    var myHeaders = new Headers();
    myHeaders.append("Cookie", "sails.sid=s%3AwcCdJfU1-ajehetKxXh_YCAvnTVq-R7t.0zXjXyaMzSoDDIDeQe9s7ZWjzml0kB7SXQsFnXo%2BO0s");

    var requestOptions = {
      method: 'GET',
      redirect: 'follow'
    };

    fetch("http://localhost:1337/User/Read", requestOptions)
      .then(response => response.text())
      .then(result => console.log(result))
      .catch(error => console.log('error', error));

  return <Router />;
}
export default App;
